import React, { useState } from 'react';

const UpdateBin = ({ bin }) => {
  const [address, setAddress] = useState(bin.address);
  const [city, setCity] = useState(bin.city);
  const [type, setType] = useState(bin.type);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Update bin logic here
    // Call an API endpoint or perform necessary actions to update the bin
    console.log('Bin updated:', { address, city, type });
  };

  return (
    <div>
      <h2>Update Bin</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Address:
          <input
            type="text"
            value={address}
            onChange={(e) => setAddress(e.target.value)}
          />
        </label>
        <label>
          City:
          <input
            type="text"
            value={city}
            onChange={(e) => setCity(e.target.value)}
          />
        </label>
        <label>
          Type:
          <input
            type="text"
            value={type}
            onChange={(e) => setType(e.target.value)}
          />
        </label>
        <button type="submit">Update</button>
      </form>
    </div>
  );
};

export default UpdateBin;
